import React, { useState } from "react";
import "./App.scss";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import AuthContext from './Context/AuthContext'
import Access from "./hook/access.hook" 
function App() {
  const access = useAccess();
  return (
    <AuthContext>
      <Router>
        <div className="App">
          <Access/>
        </div>
      </Router>
    </AuthContext>
  );
}

export default App;
